import React, { useEffect, useState } from 'react';
import Logo from '../../imgs/nav-brand.png';
import useScrollPosition from '../../RainUI/useScrollPosition';
var home = document.getElementById("homepage");
var about = document.getElementById("about");
      var roadmap = document.getElementById("roadmap");
      var partner = document.getElementById("partners");
      var Team = document.getElementById("Team");
export default function Topbar() {
  const [scrolled,setScrolled] = useState(false);
  const position = useScrollPosition();
  const [active,setActive] = useState("home");
  useEffect(()=>{
    if (position == 0){
     if (scrolled) setScrolled(false);
    } else {

      if (!scrolled) setScrolled(true);


      if (isBotton(home)){
            if (active != "home") setActive("home");
      }
      else if (isBotton(about)) {
            if (active != "about") setActive("about");
      }
      else if (isBotton(roadmap)) {
          if (active != "roadmap") setActive("roadmap");
      }
      else if (isBotton(partner)) {
        if (active != "partner") setActive("partner");
      }
      else if (isBotton(Team)) {
        if (active != "team") setActive("team");
      } 
    }
  },[position]);

  return (
    <section className={`navbar-section ` + (scrolled ? "scrolled" : "")}>
        <nav className="phoenixbar">
                <img id="nav-brand" src={Logo}/>
                <div className="nav-content">
                    <div className="nav-links">
                        <a className={"" + (active == "homepage "? "active" : "")}id="nav-link">Home</a>
                        <a className={"" + (active  == "about" ? "active" : "")} id="nav-link">About</a>
                        <a className={"" + (active  == "roadmap"? "active" : "")} id="nav-link">RoadMap</a>
                        <a className={"" + (active  == "partner"? "active" : "")} id="nav-link">PartnerShips</a>
                        <a className={"" + (active  == "team"? "active" : "")} id="nav-link">Team</a>
                        <a href="contactus.html" id="nav-link">Contact Us</a>
                    </div>
                    <div className="nav-button-wrapper">
                        <button className=""></button>
                    </div>
                </div>

        </nav>

    </section>
  )
}

function isBotton(el:any) {
  return el.getBoundingClientRect().bottom <= window.innerHeight;
}
